import {Container,Row,Col} from 'react-bootstrap';
import 'bootstrap/dist/css/bootstrap.min.css';
import "./css/GridLay.css";


function Prefoot(){
    return(
     <div id="footer" >
         <Container  >
             <Row>
                 
                <Col lg={4}>
                    
                </Col>

                <Col lg={4}>
                    <a href="App.js">TERMS & CONDITIONS</a>
                    <a href="App.js">TERMS & CONDITIONS</a>
                    <a href="App.js">TERMS & CONDITIONS</a>
                    <a href="App.js">TERMS & CONDITIONS</a>
                </Col>
                
                <Col lg={4}>
                    
                </Col>         
             </Row>
         </Container>    
     </div>
    ) ;
 }
 export default Prefoot;
